import React from 'react';
import '../../css/tweets/TwitterAccount.css';

class TwitterAccount extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {

        return (
            <div className="TwitterAccount">
                <h3>Twitter:</h3>
                <p>{this.props.twitter_account}</p>
            </div>
            );
    }
}

export default TwitterAccount;
